import React , {useEffect} from 'react';
import '../App.css';


const TodoItems = (props) => {
    useEffect(()=>{
        console.log(props.entries);
    })

return <ul>{props.entries.length > 0 && props.entries.map(item => <li key={item.key}>{item.text}</li>)}</ul>;
}


export default TodoItems;
